import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
class ListMenuItem extends Component {
  render() {
    return (
      <div className="row mt-3 ml-1 mr-1">
        <button type="button" class="btn btn-light btn-lg" style={{backgroundColor: "#ffffff"}}>
          <span href="" className="float-left" style={{ textAlign: "left" }}>
            <FontAwesomeIcon
              icon={this.props.buttonIcon}
              style={{
                width: "20%",
                height: "20px"
              }}
            />
            {this.props.buttonCaption}
          </span>
        </button>
      </div>
    );
  }
}

export default ListMenuItem;
